# Input: s = "deeedbbcccbdaa", k = 3
# Output: "aa"
# Explanation: 
# First delete "eee" and "ccc", get "ddbbbdaa"
# Then delete "bbb", get "dddaa"
# Finally delete "ddd", get "aa"

# 1 <= s.length <= 1e5
# 2 <= k <= 1e4

# s = "deeedbbccccccbdaa"
# stack =[d,d,b,b,b]
# Input: s = "pbbcggttciiippooaais", k = 2
# Output: "ps"

#Time: O(n)
#Space: O(n)
class Solution:
    def removeDuplicates(self, s: str, k: int) -> str:
        stack  =[]
        for char in s:
            if stack and stack[-1][0] == char:
                stack[-1][1]+=1
                if stack[-1][1] == k:
                    stack.pop()
            else:
                stack.append([char,1])
        ans = ""
        for char,cnt in stack:
               ans+=char*cnt
        print(ans)
        return ans     

sol = Solution()
sol.removeDuplicates("",10000)
sol.removeDuplicates("deeedbbcccbdaa", 3)
                